let baseUrl = {
    url: "https://jsonplaceholder.typicode.com/"
}
export default function get(endpoint) {
    try {
        fetch(baseUrl.url + endpoint)
            .then((res) =>  res)
            // .then((json)=>  json)
            .catch((err) => {
                return err
            })
    } catch (err) {
        console.error(err)
    }
}
